import React from "react";
import { View, Text } from "react-native";
import { useSelector, useDispatch } from "react-redux";

export default function TaskListPage() {
  const dispatch = useDispatch();

  React.useEffect(() => {
    dispatch(getTasks());
  }, []);

  return (
    <View>
      <Text>Hello Word!</Text>
    </View>
  );
}
